const Komentar = () => {
  return (
    <div style={{ marginLeft: "20px" }}>
      <img style={{width}}
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/be/Joko_Widodo_2019_official_portrait.jpg/800px-Joko_Widodo_2019_official_portrait.jpg"
        alt="poto"
      />{" "}
      <p style={{ marginLeft: "30px", fontWeight: "bold" }}>John Doe</p>
    </div>
  );
};

export default Komentar;
